import React, { Fragment, useContext } from "react";
import { Power } from "react-bootstrap-icons";
import { useHistory } from "react-router-dom";
import AuthContext from '../../store/auth-context';

const Dashboard = () => {
    const history = useHistory();
    const context = useContext(AuthContext);

    const logoutHandler = () => {
        context.logout();
        history.replace('/auth');
    }

    return (
        <Fragment>
            <div className="container mt-3">
                <div className="row">
                    <div className="shadow rounded-3">
                        <div className="p-3">
                            <div className="row">
                                <div className="col-10">
                                    <h3 className="text-secondary">Dashboard</h3>
                                </div>
                                <div className="col-2">
                                    <button className="btn btn-danger rounded-circle float-end" onClick={logoutHandler}><Power size={18} className="mb-1" /></button>
                                </div>
                            </div>
                            <hr />
                            <div className="row">
                                <div className="col-6">
                                    <div className="border border-1">
                                        <div className="p-3">
                                            <h3>List of your files</h3>
                                            <hr />
                                        </div>
                                    </div>
                                </div>
                                <div className="col-6 border border-1">
                                    <div className="p-3">
                                        <h3>Add New file</h3>
                                    </div>
                                </div>

                            </div>
                        </div>
                    </div>

                </div>
            </div>
        </Fragment>
    )
}
export default Dashboard;
